column12:
CSRU 7P-7A Nursing update
Neuro: Oriented x3; No neuro deficits noted on assessment; Slept for most of night after ambien;
CV: Sinus rhythm/sinus brady with PAC's; BP stable-Neo currently off; See carevue flow sheet; Skin cool, dry; R foot pulses dopplered; Slight edema over extrems;
Resp: 2-3l nc throughout night; Lungs cl/coarse; Productive cough-tan, bld tinged sm amount; Resps NL; O2 sats 93-99%; CT to H2O seal-draining serosang; ISB < 500
GI: Active bowel sounds; NG in place, clamped-pt requesting pills crushed d/t difficulty swallowing; Abd soft ND; Pt denies Nausea
GU: 3 way foley in place; Irrigating lumen clamped; Urine yellow w/sed; Amount borderline;
Pain: denies pain
Skin: Sternal incision covered by DSD-intact clean; ACE to R leg, to be taken off today; Underneath ace, small incisions by knee and inside of ankle-covered by steri strips-intact;
Plan: D/C NG tube-start on diet; OOB to chair today?; Monitor hemodynamics; Change amio to PO?; Prepare for floor;

npn 7p-7a (see also careview flownotes for objective data)

dx: s/p lam; DT's; sepsis/resp failure;

neuro:
remains [** **] on Fent 20, versed 3, propofol 50; Fent increased to 22 and Versed to 4 for about 5 hours to assist sleep.rest, returned to previous settings later in shift; purposeful communication and movements attempted; PERLA:

c-v:
b/p stable; hypotensive briefly x1 when sleeping, after having recieved IV lasix; hrt rate NSR/NST, no ectopy; SCD's in use;

resp:
developed tachypnea, with shallower MV's, put on A/C temporarily to rest, returned to PS/Peep;
   continues to make copious secretions, especially orally;

g-i:
continues to tolerate tube feeds; no stool this night;

g-u:
foley patent; receiving lasix to assist  getting off interstitial fluid, also recieving K+ supplements  for low serum K+ levels;

social:
sister states pt does have hx anxiety problems, hx of taking anti-depressant; psych consult recommended possible need for Haldol or med to assist anxiety awith preparation for and extubation process;

PLAN:
1) bring to team's attention re pt's anxiety
2) frequent suctioning
3) ? scopalamine patch for excess secretions (if not contra-indicated)
4) check results a.m. labs
4)
